import React, { Component } from 'react';
import './slideshow.css';



const Slideshow=()=>{
    return(
      <div class="container">
      <div class="css-carousel">
        <image class="css-img" src="http://placehold.it/350x150" />
        <image class="css-img" src="http://placehold.it/350x150/1A0000"/>
        <image class="css-img" src="http://placehold.it/350x150/330000" />
        <image class="css-img" src="http://placehold.it/350x150/4c0000" />
      </div>
    </div>
    )
}
export default  Slideshow;
